import React from "react";
import Navbar from "../Navbar/Navbar";
import SideBar from "../Navbar/SideBar";
import "./MensPage.css";
import { useEffect } from "react";
import { useState } from "react";
const MensProduct = () => {
  const [lists, setLists] = useState([]);
  useEffect(() => {
    getMensData();
  }, []);

  const getMensData = () => {
    fetch("http://localhost:3003/mens")
      .then((d) => d.json())
      .then((res) => {
        setLists(res);
      });
  };
  return (
    <>
      <div className="containerr">
        {lists.map((curr) => {
          return (
            <>
              <div className="inside" key={curr.id}>
                <div className="items">
                  <p>
                    <span>Name:</span>
                    {curr.title}
                  </p>
                </div>
                <div className="items">
                  <p>
                    <span>Category:</span>
                    {curr.color}
                  </p>
                </div>
                <div className="items">
                  {" "}
                  <p>
                    <span>Price:</span>
                    {curr.price}
                  </p>
                </div>
              </div>
              <button>Prev</button>
              <button>Next</button>
            </>
          );
        })}
      </div>
    </>
  );
};

export default MensProduct;
